import React from 'react';
import "./signup.css";

const SignUp = () => {
  return (
    <div className='singup'>
      <form action="">
        <div>
          <label htmlFor="fname">
            <input type="text" />
          </label>
        </div>
      </form>
    </div>
  )
}

export default SignUp;
